import React from "react";
import { useHistory } from "react-router-dom";


import './App.css'


const WeatherComponent = (props) => {
    const { prop1, prop2, prop3, onDelete } = props;
    const history = useHistory();

    const handleDelete = () => {
        onDelete();
    }

    const navigateToFullWeatherPage = () => {
        // Use history.push to navigate to the fullweatherpage route
        history.push("/fullweatherpage");
      };

    return (

            <div className="weatherDiv" onClick={navigateToFullWeatherPage} >
            <p>{prop1}</p>
            <p>{prop2}</p>
            <p>{prop3}</p>
            <button onClick={handleDelete}>-</button>
        </div>




    );
}


export default WeatherComponent;
